import React from 'react'
import {Link} from "react-router-dom";



const AuthorItem = ({author}) => {
    return (
        <tr>
            <td>
                {author.id}
            </td>
            <td>
                {author.map((author) => (
                    <li key={author.id}>
                        <Link to={author.id}>{author.name}</Link>
                    </li>))}
            </td>
            <td>
                {author.last_name}
            </td>
            <td>
                {author.birthday_year}
            </td>
        </tr>
    )
}

const AuthorList = ({ author }) => {
    return (
        <table>
            <th>
                id автора
            </th>
            <th>
                Имя автора
            </th>
            <th>
                Фамилимя автора
            </th>
            <th>
                год рождения автора
            </th>
            {author.map((author) => <AuthorItem author={author} />)}
        </table>
    )
}

export default AuthorList
